import React from "react";
import { Link } from "react-router-dom";
import "./HeaderMain.css";

function HeaderMain() {
  return (
    <header>
      <div className="container">
        <div className="logo">
          <h1>API.app</h1>
        </div>
        <div className="btn-newPost">
          <Link to="/post">
            <button>Add New Post</button>
          </Link>
          <Link to="/edit">
            <button>Edit</button>
          </Link>
        </div>
      </div>
    </header>
  );
}

export default HeaderMain;
